    false,nt"url": null,nt"notes": "This annual narrative report for Koyukuk
    NWR outlines Refuge accomplishments during the 1983 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan
    and research and investigations. Refuge administration is outlined; information
    about personnel, manpower programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, fire management, and wilderness
    areas. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, and fisheries resources. The public uses of the Refuge described in
    this report include hunting, fishing, trapping, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation,
    equipment replacement, communication systems, and energy conservation. Cooperative
    programs and items of interest are provided at the end.",nt"license_title":
